@import url('https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@100;300;400;500;700;900&display=swap');

/* 기본 */
*{margin: 0; padding: 0;}
html,select,button{font-family: 'Noto Sans KR';color: #333;}

li, ul, ol, a{list-style: none; color: inherit; text-decoration: none;}
h1, h2, h3, h4, h5, h6{font-weight: normal;}
.img{position: relative;}
a{display: block;}
img{display: block; width: 100%; height: auto;}
button{background: none; border: none; display: block;}


/* 양식 통일용 */
h1{
    font-size: 36px; font-weight: bold;
    text-align: center;
    margin-bottom: 15px;
    text-transform: uppercase;
    }
.tab_list{
    text-align: center;
    margin-bottom: 15px;
    }
.tab_list button{
    background: none;
    border: none;
    margin-right: 20px;

    &:last-child{margin-right: 0;}
    &:before{content: "#";}
}





/* scss mixin */
$mainC: #0E0057;

@mixin secWidth{
    width: 1320px;
    margin: 0 auto;
    box-sizing: border-box; 
}
@mixin flexSB{display: flex; justify-content: space-between;}

section,.header_inner,.footer_inner{@include secWidth;}
section,.footer_inner{
    padding: 80px 10px;
    box-sizing: border-box;
}




/********** header **********/
.header{
    position: fixed;
    z-index: 999;
    width: 100%;
    background: #fff;

    .header_inner{
        height: 100px;
        @include flexSB;
        align-items: center;
        color: #333;
        overflow: hidden;
        transition: .3s;

        &.scroll_down{height: 0;}
        &.scroll_up{height: 100px;}

        .logo{
            width: 140px;
            padding-left: 10px;
            padding-right: 120px;
            
            svg{
            fill: #333;
        }
    }

    .gnb>ul{
        display: flex;

        >li{
            box-sizing: border-box;
            height: 100px;
            padding: 0 20px;
            
            &:nth-child(3){
                padding-right: 40px;
            }
            &:nth-child(4){
                padding-left: 40px;
            }

            &:nth-child(3)>a::after{
                content: "";
                width: 1px; height: 40px;
                display: block;
                background-color: #ccc;
                position: absolute;
                right: -40px; top: 30px;

            }


            >a{
                position: relative;
                padding-top: 30px;
                line-height: 40px;
                font:{
                    size: 20px;
                    weight: bold;
                }

                border-bottom: 1px solid rgba(255,255,255,0);
                transition: .2s;
            }//a

            &:hover>a{border-bottom: 1px solid #333;}

            /* hovermenu */
            .gnb_hover{
