/* filter */
.filter{
    width: 1320px; margin: 0 auto;
    .filter_top{
        @include flexSB();
        align-items: center;
        height: 55px;

        .left button{
            border-right: 1px solid #aaa;
            padding-right: 10px;
            span{font-size: 16px; transform: translateY(3px);}
        }
        .right{
            display: flex;
            #product_sort{
                width: 165px;
                margin-right: 20px;
                border: 1px solid #eee;
                outline: none;
            }
            
            input[type=radio]{display: none;}
            input[type=radio]:nth-child(1):checked ~ .view_type_c label:nth-child(1) span{color:#000}
            input[type=radio]:nth-child(2):checked ~ .view_type_c label:nth-child(2) span{color:#000}
            .view_type_c{
                display: flex;
                align-items: center;
                cursor: pointer;
                
                span{
                    width: 40px;
                    font-size: 32px;
                    text-align: center;
                    color: #aaa;
                    &:nth-child(2){
                        font-size: 36px;
                    }
                }
            }
        }
    }

    .filter_bottom{
        display: flex;
        >div{
            padding: 0 15px;
            box-sizing: border-box;
            width: calc(100%/6);

            p.tit{font-size: 20px; font-weight: bold; margin-bottom: 10px;}
            li{line-height: 35px; cursor: pointer;}
            label{display: block; line-height: 35px;}
        }//div 공통

        .filter_category{
            li.on{font-size: 20px; font-weight: bold; text-decoration: underline;}
        }

        //checkbox 커스텀하는 법: before로 체크박스 / after로 체크표시 넣고 z-index랑 다른 것들로 위치조정하기
        

        .filter_color{
            input[type=checkbox]{display: none;}
            background-color: #fff;
            .color_list{
                display: flex;
                
                flex-wrap: wrap;

                label{
                    width: calc((100% - 50px)/6); height: 23.33px;
                    margin-right: 10px;
                    margin-bottom: 10px;
                    &:nth-child(6n){margin-right: 0;}
                    border-radius: 50%;
                    background-position: center;
                }

                @for $i from 1 through 13{
                    label:nth-child(#{$i}){
                        background-image: url(./img/color_#{$i}.jpg);}
                }
            }            
        }//filter_color

        .filter_size{
            input[type=checkbox]{display: none;}
            .size_list{
                display: flex;
                flex-wrap: wrap;
                label{
                    width: calc((100% - 30px)/4);
                    margin-right: 10px;
                    margin-bottom: 10px;

                    box-sizing: border-box;
                    border: 1px solid #aaa; 
                    border-radius: 3px;

                    text-align: center;

                    &:nth-child(4n){margin-right: 0;}
                }
            }

        }

    }//filter_bottom
}//filter









